const DEFAULT_KATRA = 5
const MINIMUM_KATRA = 4
const MAKSIMUM_KATRA = 10

function prosesKata(data, length): String[] {
  if (typeof length !== "number") return []
  const _length = Math.floor(length)

  if (_length < 1) return []

  const filtered = []
  const array = data.split(" ")
  for (let item of array) {
    if (item.length == _length) filtered.push(item)
  }
  return filtered
}

/**
 * Memberi daftar kata benda dengan jumlah huruf tertentu.
 * @param length jumlah huruf, default 5
 * @returns Daftar kata benda dengan jumlah huruf seperti yang diminta
 */
export function kataBenda(length = 5): String[] {
  return prosesKata(KATABENDA, length)
}

export function kataSifat(length = 5): String[] {
  return prosesKata(KATASIFAT, length)
}

function _terpanjang(data) {
  const array = data.split(" ")
  let terpanjang = ""
  for (let item of array) {
    if (item.length > terpanjang.length) terpanjang = item
  }
  return terpanjang
}

export function terpanjang(kelasKata = ""): String {
  const kelas = kelasKata.toString().toLowerCase()
  const ikb = kelas.indexOf("benda")
  const iks = kelas.indexOf("sifat")

  if (ikb < 0 && iks < 0) {
    const kb = _terpanjang(KATABENDA)
    const ks = _terpanjang(KATASIFAT)
    if (kb.length == ks.length) return kb
    return kb.length > ks.length ? kb : ks
  } else if (ikb >= 0 && iks < 0) {
    return _terpanjang(KATABENDA)
  } else if (iks >= 0 && ikb < 0) {
    return _terpanjang(KATASIFAT)
  }

  return ikb < iks ? _terpanjang(KATABENDA) : _terpanjang(KATASIFAT)
}

/**
 *
 * @param jumlahHurufKataBenda
 * @param jumlahHurufKataSifat
 */
export function katra(
  jumlahHurufKataBenda = 5,
  jumlahHurufKataSifat = 5
): String {
  if (typeof jumlahHurufKataBenda !== "number") {
    throw new Error("Parameter jumlahHurufKataBenda harus berupa angka")
  }

  if (typeof jumlahHurufKataSifat !== "number") {
    throw new Error("Parameter jumlahHurufKataSifat harus berupa angka")
  }

  let kb = Math.floor(jumlahHurufKataBenda)
  if (kb < MINIMUM_KATRA) kb = DEFAULT_KATRA
  if (kb > MAKSIMUM_KATRA) kb = DEFAULT_KATRA
  let ks = Math.floor(jumlahHurufKataSifat)
  if (ks < MINIMUM_KATRA) ks = DEFAULT_KATRA
  if (ks > MAKSIMUM_KATRA) ks = DEFAULT_KATRA

  const dfKb = kataBenda(kb)
  const dfKs = kataSifat(ks)
  const k1 = dfKb[Math.floor(Math.random() * dfKb.length)]
  const k2 = dfKs[Math.floor(Math.random() * dfKs.length)]
  return `${k1}-${k2}`
}
